import styled from 'styled-components';
import { useTheme } from '@material-ui/core';

export default component => {
  const theme = useTheme();

  console.log({ theme });

  return styled(component)`
    * {
      border: ${props => console.log({ props }) || 0};
      margin: 0;
      padding: 0;
    }
  `;
};
